function initialHeader(){
    if($.cookie("token")){
      let baseUrl=getBaseUrl();
      let data={
        token:$.cookie("token")
      }
      $.ajax({
        url:baseUrl+'user/getUserByToken',
        type:'GET',
        data:data,
        dataType:'json',
        contentType:"application/json; charset=utf-8",
        time:5000,
        success:function(res){
          if(res.code==200){
            $(".username").text(res.data.username);
            $.cookie("username",res.data.username);
            $("#username_logout").show();
            $("#login_register").hide();
          }
        },
        error:function(){
          layer.msg('網絡錯誤',{icon:2,time:1000});
          $("#username_logout").show();
          $("#login_register").hide();
        }
      });
    }else{
      $("#login_register").show();
      $("#username_logout").hide();
    }
  }
function logout(){
    $.removeCookie("token");
    layer.msg('賬號已登出',{icon:1,time:1000},function(){
        location.href="/login.html";
    });
}
function getRandomKey(){
  let timestamp=new Date().getTime();
  let username=$.cookie("username");
  return (username+timestamp);
}
